export default makeStyles((theme) => ({
    root:{
        display: 'flex',
    },
    details:{
        display:'flex',
        flexDirection: 'column'
    },
    itemImage:{
        width: '77px',
        height: '77px',
        
    },
    itemName:{
        fontFamily: "Roboto",
        fontWeight: '1000',
        fontSize: '14px',
        fontStyle: 'normal',
    },
    itemType:{
        color: '#838383',
        fontFamily:'Roboto',
        fontStyle:'normal',
        fontWeight: '500',
        fontSize: '12px',
        lineHeight: '14px'

    }
}))
